import React, { useState } from "react";
import Book_manu from "./component/basics/BookStore";
import DarkModeToggle from "react-dark-mode-toggle";

const App = () => {
  const [isDarkMode, setIsDarkMode] = useState(() => false);

  return (
    <>
      <Book_manu />
      <DarkModeToggle
        onChange={setIsDarkMode}
        checked={isDarkMode}
        size={80}
      ></DarkModeToggle>
    </>
  );
};

export default App;
